[{"location":"api/#GravitationalPotentials","page":"API reference","title":"GravitationalPotentials","text":"","category":"section"},{"location":"api/","page":"API reference","title":"API reference","text":"Documentation for GravitationalPotentials.","category":"page"},{"location":"api/#Index","page":"API reference","title":"Index","text":"","category":"section"},{"location":"api/","page":"API reference","title":"API reference","text":"","category":"page"},{"location":"api/#Docstrings","page":"API reference","title":"Docstrings","text":"","category":"section"},{"location":"api/","page":"API reference","title":"API reference","text":"MassDensityModel","category":"page"},{"location":"api/#GravitationalPotentials.MassDensityModel","page":"API reference","title":"GravitationalPotentials.MassDensityModel","text":"MassDensityModel\n\nAbstract type for all mass density models. Any subtype of MassDensityModel should have a corresponding mass_density implementation.\n\n\n\n\n\n","category":"type"},{"location":"api/","page":"API reference","title":"API reference","text":"Modules = [GravitationalPotentials]\nFilter = t -> t !== MassDensityModel","category":"page"},{"location":"api/#GravitationalPotentials.EinastoDensity","page":"API reference","title":"GravitationalPotentials.EinastoDensity","text":"EinastoDensity <: MassDensityModel\n\nFields\n\ncentral_density\nharmonic_mean_radius\nN\nk\n\nSee Einasto, J. and Haud, U., “Galactic models with massive corona. I. Method”, Astronomy and Astrophysics, vol. 223, no. 1, pp. 89–94, 1989.\n\nSee also the implementation of mass_density for this type.\n\n\n\n\n\n","category":"type"},{"location":"api/#GravitationalPotentials.PowerLawSphereDensity","page":"API reference","title":"GravitationalPotentials.PowerLawSphereDensity","text":"PowerLawSphereDensity <: MassDensityModel\n\nModel for a sphere with a power law density centered at the origin.\n\nFields\n\nradius: radius of the sphere\nscale_density: scale density of the sphere, density changes by  scale_density^alpha at radius = scale_radius\nscale_radius: scale radius of the sphere\nalpha: power by which density reduces with respect to radius\n\nSee also the implementation of mass_density for this type.\n\n\n\n\n\n","category":"type"},{"location":"api/#GravitationalPotentials.SpiralGalaxyDensity","page":"API reference","title":"GravitationalPotentials.SpiralGalaxyDensity","text":"SpiralGalaxyDensity <: MassDensityModel\n\nModel for a spiral galaxy that has both a disk and a central bulge, with the bulge density dominating in the overlap.\n\nThe bulge is modeled as a uniform density sphere, and the disk is modeled as a uniform density cylinder.\n\nFields\n\nbulge_radius: radius of the bulge\ndisk_radius: radius of the disk\ndisk_height: height of the disk\nbulge_density: density of the bulge\ndisk_density: density of the cylinder\n\nSee also the implementation of mass_density for this type.\n\n\n\n\n\n","category":"type"},{"location":"api/#GravitationalPotentials.UniformCylinderDensity","page":"API reference","title":"GravitationalPotentials.UniformCylinderDensity","text":"UniformCylinderDensity <: MassDensityModel\n\nModel for a uniform density cylinder centered at the origin.\n\nFields\n\nradius: radius of the cylinder\nheight: height of the cylinder\ndensity: density of the cylinder\n\nSee also the implementation of mass_density for this type.\n\n\n\n\n\n","category":"type"},{"location":"api/#GravitationalPotentials.UniformSphereDensity","page":"API reference","title":"GravitationalPotentials.UniformSphereDensity","text":"UniformSphereDensity <: MassDensityModel\n\nModel for a uniform density sphere centered at the origin.\n\nFields\n\nradius: radius of the sphere\ndensity: density of the sphere\n\nSee also the implementation of mass_density for this type.\n\n\n\n\n\n","category":"type"},{"location":"api/#GravitationalPotentials.mass_density","page":"API reference","title":"GravitationalPotentials.mass_density","text":"mass_density(model::MassDensityModel, s, φ, z)\n\nGiven a mass density profile/model, return the corresponding mass density at cylindrical coordinates (s φ z).\n\n\n\n\n\n","category":"function"},{"location":"api/#GravitationalPotentials.mass_density-Tuple{EinastoDensity, Any, Any, Any}","page":"API reference","title":"GravitationalPotentials.mass_density","text":"mass_density(model::EinastoDensity, s, φ, z)\n\nDensity model\n\nρ(s φ z) = ρ₀ expleft-(a  k a₀)^1Nright\n\nwhere\n\na = sqrts^2 + z^2\nρ₀ = model.central_density\na₀ = model.harmonic_mean_radius\nk = model.k\nN = model.N\n\n\n\n\n\n","category":"method"},{"location":"api/#GravitationalPotentials.mass_density-Tuple{PowerLawSphereDensity, Any, Any, Any}","page":"API reference","title":"GravitationalPotentials.mass_density","text":"mass_density(model::PowerLawSphereDensity, s, φ, z)\n\nDensity model\n\nρ(s φ z) = begincases\n    ρ_0 left(sqrts^2 + z^2R_0right)^α  textif  sqrts^2 + z^2  R_s \n    0  textotherwise\nendcases\n\nwhere\n\nρ_0 = model.scale_density\nR_0 = model.scale_radius\nα = model.alpha\nR_s = model.radius\n\n\n\n\n\n","category":"method"},{"location":"api/#GravitationalPotentials.mass_density-Tuple{SpiralGalaxyDensity, Any, Any, Any}","page":"API reference","title":"GravitationalPotentials.mass_density","text":"mass_density(model::SpiralGalaxyDensity, s, φ, z)\n\nDensity model\n\nρ(s φ z) = begincases\n    ρ_b  textif  sqrts^2 + z^2  R_b \n    ρ_d  textif  s  R_d z  H_d \n    0  textotherwise\nendcases\n\nwhere\n\nρ_b = model.bulge_density\nρ_d = model.disk_density\nR_b = model.bulge_radius\nR_d = model.disk_radius\nH_d = model.disk_height\n\n\n\n\n\n","category":"method"},{"location":"api/#GravitationalPotentials.mass_density-Tuple{UniformCylinderDensity, Any, Any, Any}","page":"API reference","title":"GravitationalPotentials.mass_density","text":"mass_density(model::UniformCylinderDensity, s, φ, z)\n\nDensity model\n\nρ(s φ z) = begincases\n    ρ_0  textif  s  R_c z  H_c \n    0  textotherwise\nendcases\n\nwhere\n\nρ_0 = model.density\nR_c = model.radius\nH_c = model.height\n\n\n\n\n\n","category":"method"},{"location":"api/#GravitationalPotentials.mass_density-Tuple{UniformSphereDensity, Any, Any, Any}","page":"API reference","title":"GravitationalPotentials.mass_density","text":"mass_density(model::UniformSphereDensity, s, φ, z)\n\nDensity model\n\nρ(s φ z) = begincases\n    ρ_s  textif  sqrts^2 + z^2  R_s \n    0  textotherwise\nendcases\n\nwhere\n\nρ_s = model.density\nR_s = model.radius\n\n\n\n\n\n","category":"method"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = GravitationalPotentials","category":"page"},{"location":"#GravitationalPotentials","page":"Home","title":"GravitationalPotentials","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for GravitationalPotentials.","category":"page"}]
